import React from 'react';
import classes from './Employee.module.css';
const Employee = (props) => {
 const EmployListProcessed = props.data.map((employee, id) => {
  return (
   <>
    <div key={"B" + id} className={classes.Employee}>
     <div className={classes.Rounded}>{employee.avatar}</div>
     <h2>Joe Don</h2>
     <h2>ID: ###</h2>
     <p>Email:email@mail.com</p>
    </div>
   </>
  )
 })
 return (
  <>
   {EmployListProcessed}
  </>
 )
}

export default Employee;
